import './App.css';
import avatar from './images/my-avatar2.png';

function App() {
  return (
    <div className="App">
      <div className="sidebar">
        <div className="sidebar-square">
          <img src={avatar} alt="my-avatar" className="avatar-image"/>
        </div>
        <h1>Lilly Ko</h1>
        <div className="contact-tag" style="white">lillyxcko@gmail.com</div>

      </div>
      <div className="main-content">
        <h1>Front-End Dev</h1>
        <h2>UX Designer</h2>

      </div>
    </div>
  );
}

export default App;
